# https://www.di-mgt.com.au/rsa_factorize_n.html
def factor_n_given_d_and_e(N, d, e):
    k = (d * e) - 1
    t = 0
    x = 0
    while True:
        g = random.randint(2, N - 1)
        t = k
        while (t % 2) == 0:
            t //= 2
            x = pow(g, t, N)
            y = math.gcd(x - 1, N)
            if (x > 1) and (y > 1):
                p = y
                q = N // y
                return p, q

p, q = factor_n_given_d_and_e(N, d, e)
assert((p * q) == N)

phi = (p - 1) * (q - 1)
d = pow(0x10001, -1, phi)
m = pow(c, d, N)

flag = m.to_bytes(length=(m.bit_length() + 7) // 8, byteorder="big")
